class Solution {
  List<int> beautifulIndices(String s, String a, String b, int k) {
    final List<int> aIndices = [], bIndices = [], result = [];
    for (int i = 0; i <= s.length - a.length; i++) {
      if (s.substring(i, i + a.length) == a) aIndices.add(i);
    }
    for (int i = 0; i <= s.length - b.length; i++) {
      if (s.substring(i, i + b.length) == b) bIndices.add(i);
    }
    int ai = 0, bi = 0;
    while (ai < aIndices.length && bi < bIndices.length) {
      if ((aIndices[ai] - bIndices[bi]).abs() <= k) {
        result.add(aIndices[ai]);
        ai++;
      } else if (aIndices[ai] < bIndices[bi]) {
        ai++;
      } else {
        bi++;
      }
    }
    return result;
  }
}
